        InstanceJournal(id: 73, name: "Blackwing Descent", map: InstanceMapIndex(name: "Blackwing Descent", id: 669), description: "Nefarian and his warped attempts to create a new breed of dragon were thought to be defeated after his death in Blackwing Lair. Yet tales have emerged that his father, Deathwing, has reanimated  Nefarian and set him to work in Blackwing Descent. The gruesome experiments being conducted there are feared to be on a level of wickedness far surpassing Nefarian\'s previous crimes against nature.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/169?namespace=static-8.3.7_35114-eu"), id: 169, name: "Omnotron Defense System"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/170?namespace=static-8.3.7_35114-eu"), id: 170, name: "Magmaw"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/171?namespace=static-8.3.7_35114-eu"), id: 171, name: "Atramedes"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/172?namespace=static-8.3.7_35114-eu"), id: 172, name: "Chimaeron"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/173?namespace=static-8.3.7_35114-eu"), id: 173, name: "Maloriak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/174?namespace=static-8.3.7_35114-eu"), id: 174, name: "Nefarian\'s End")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN", name: "10 Player"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN", name: "25 Player"), players: 25, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN_HEROIC", name: "10 Player (Heroic)"