        InstanceJournal(id: 74, name: "Throne of the Four Winds", map: InstanceMapIndex(name: "Throne of the Four Winds", id: 754), description: "Al\'Akir the Windlord\'s personal lair, the Throne of the Four Winds, glides high among Skywall\'s boundless vistas. Now that the barriers of the Elemental Plane have been ruptured, Al\'Akir is free to travel Azeroth\'s winds at his leisure. He has mustered his fiercest tempests to scour Uldum of life and seize control of the mysterious titan-forged Halls of Origination.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/154?namespace=static-8.3.7_35114-eu"), id: 154, name: "The Conclave of Wind"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/155?namespace=static-8.3.7_35114-eu"), id: 155, name: "Al\'Akir")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN", name: "10 Player"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN", name: "25 Player"), players: 25, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN_HEROIC", name: "10 Player (Heroic)"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN_HEROIC", name: "25 Player (Heroic)"), players: 25, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/74?namespace=static-8.3.7_35114-eu"), id: 74), minimumLevel: 85, category: InstanceCategory(type: .raid)),
        InstanceJournal(id: 75, name: "Baradin Hold", map: InstanceMapIndex(name: "Baradin Hold", id: 757), description: "Following the Second War, the ruined fortress of Baradin Hold on the remote island of Tol Barad was converted into a prison for some of the most dangerous forces on Azeroth. Yet with the devastation wrought by the Cataclysm, the prison\'s integrity has been compromised. Now as the Horde and Alliance vie for supremacy on the island, the liberation of its forgotten horrors may be at hand.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/139?namespace=static-8.3.7_35114-eu"), id: 139, name: "Argaloth"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/140?namespace=static-8.3.7_35114-eu"), id: 140, name: "Occu\'thar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/339?namespace=static-8.3.7_35114-eu"), id: 339, name: "Alizabal, Mistress of Hate")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN", name: "10 Player"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN", name: "25 Player"), players: 25, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/75?namespace=static-8.3.7_35114-eu"), id: 75), minimumLevel: 85, category: InstanceCategory(type: .raid)),
        InstanceJournal(id: 78, name: "Firelands", map: InstanceMapIndex(name: "Firelands", id: 720), description: "The Firelands is the molten domain forged by the titans to house Ragnaros and his wayward minions. Following Deathwing\'s emergence into Azeroth, Ragnaros and his servants surged onto the slopes of Mount Hyjal before being driven back by the sacred mountain\'s valiant defenders. Now Ragnaros is rallying his loyalists to defend the Firelands from Azeroth\'s champions.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/192?namespace=static-8.3.7_35114-eu"), id: 192, name: "Beth\'tilac"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/193?namespace=static-8.3.7_35114-eu"), id: 193, name: "Lord Rhyolith"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/194?namespace=static-8.3.7_35114-eu"), id: 194, name: "Alysrazor"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/195?namespace=static-8.3.7_35114-eu"), id: 195, name: "Shannox"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/196?namespace=static-8.3.7_35114-eu"), id: 196, name: "Baleroc, the Gatekeeper"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/197?namespace=static-8.3.7_35114-eu"), id: 197, name: "Majordomo Staghelm"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/198?namespace=static-8.3.7_35114-eu"), id: 198, name: "Ragnaros")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73?namespace=static-8.3.7_35114-eu"), name: "Cataclysm"), modes: [InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 30, isTracked: false), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 30, 