        InstanceJournal(id: 187, name: "Dragon Soul", map: InstanceMapIndex(name: "Dragon Soul", id: 967), description: "Forged by Deathwing during the War of the Ancients, the Dragon Soul harnessed the combined power of the dragonflights until it was ultimately destroyed. Through the Caverns of Time, Thrall and the remaining dragonflights were able to recover the powerful artifact before its destruction.  Now they have rallied at Wyrmrest Temple in a desperate attempt to use the might of the Dragon Soul against Deathwing himself.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/311?namespace=static-8.3.7_35114-eu"), id: 311, name: "Morchok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/324?namespace=static-8.3.7_35114-eu"), id: 324, name: "Warlord Zon\'ozz"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/325?namespace=static-8.3.7_35114-eu"), id: 325, name: "Yor\'sahj the Unsleeping"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/317?namespace=static-8.3.7_35114-eu"), id: 317, name: "Hagara the Stormbinder"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/331?namespace=static-8.3.7_35114-eu"), id: 331, name: "Ultraxion"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/332?namespace=static-8.3.7_35114-eu"), id: 332, name: "Warmaster Blackhorn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/318?namespace=static-8.3.7_35114-eu"), id: 318, name: "Spine of Deathwing"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/333?namespace=static-8.3.7_35114-eu"), id: 333, name: "Madness of Deathwing")], expansion: ExpansionIndex(id: 73, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/73