        InstanceJournal(id: 317, name: "Mogu\'shan Vaults", map: InstanceMapIndex(name: "Mogu\'shan Vaults", id: 1008), description: "The mogu, proud of their supremacy, kept lengthy records of their accomplishments within a great complex of vaults. The construction of these vast chambers predate any pandaren written records, shrouding their depths in mystery. Rumors once circulated of a mighty army locked within; for this reason, the vaults were the first target of the ancient pandaren rebellion, and they have been sealed ever since the mogu empire was overthrown.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/679?namespace=static-8.3.7_35114-eu"), id: 679, name: "The Stone Guard"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/689?namespace=static-8.3.7_35114-eu"), id: 689, name: "Feng the Accursed"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/682?namespace=static-8.3.7_35114-eu"), id: 682, name: "Gara\'jal the Spiritbinder"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/687?namespace=static-8.3.7_35114-eu"), id: 687, name: "The Spirit Kings"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/726?namespace=static-8.3.7_35114-eu"), id: 726, name: "Elegon"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/677?namespace=static-8.3.7_35114-eu"), id: 677, name: "Will of the Emperor")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "LFR", name: "Raid Finder"), players: 25, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN", name: "10 Player"), players: 10, isTracked: true), InstanceMode(mode