        InstanceJournal(id: 320, name: "Terrace of Endless Spring", map: InstanceMapIndex(name: "Terrace of Endless Spring", id: 996), description: "Hidden high in the mountains, the Terrace of Endless Spring is the sacred center of the Vale of Eternal Blossoms. Its peaceful fountains are said to have the power to heal and rejuvenate, but when the Sha of Fear attacked, many of the complex\'s guardians turned on each other in fits of terror.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/683?namespace=static-8.3.7_35114-eu"), id: 683, name: "Protectors of the Endless"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/742?namespace=static-8.3.7_35114-eu"), id: 742, name: "Tsulong"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/729?namespace=static-8.3.7_35114-eu"), id: 729, name: "Lei Shi"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/709?namespace=static-8.3.7_35114-eu"), id: 709, name: "Sha of Fear")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "LFR", name: "Raid Finder"), players: 25, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN", name: "10 Player"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN", name: "25 Player"), players: 25, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN_HEROIC", name: "10 Player (Heroic)"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN_HEROIC", name: "25 Player (Heroic)"), players: 25, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/320?namespace=static-8.3