        InstanceJournal(id: 330, name: "Heart of Fear", map: InstanceMapIndex(name: "Heart of Fear", id: 1009), description: "The Sha of Fear has corrupted the grand empress of the mantid. Her increasingly erratic and paranoid commands have driven the Klaxxi--the keepers of mantid culture--to take aggressive action. Because they are few in number, the Klaxxi are reluctantly willing to accept outside help in destroying the empress and purging their race of the sha\'s negative influence.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/745?namespace=static-8.3.7_35114-eu"), id: 745, name: "Imperial Vizier Zor\'lok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/744?namespace=static-8.3.7_35114-eu"), id: 744, name: "Blade Lord Ta\'yak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/713?namespace=static-8.3.7_35114-eu"), id: 713, name: "Garalon"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/741?namespace=static-8.3.7_35114-eu"), id: 741, name: "Wind Lord Mel\'jarak"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/737?namespace=static-8.3.7_35114-eu"), id: 737, name: "Amber-Shaper Un\'sok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/743?namespace=static-8.3.7_35114-eu"), id: 743, name: "Grand Empress Shek\'zeer")], expansion: ExpansionIndex(id: 74, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/74?namespace=static-8.3.7_35114-eu"), name: "Mists of Pandaria"), modes: [InstanceMode(mode: InstanceModeName(type: "LFR", name: "Raid Finder"), players: 25, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_10_MAN", name: "10 Player"), players: 10, isTracked: true), InstanceMode(mode: InstanceModeName(type: "LEGACY_25_MAN", name: "25 Player"), playe