        InstanceJournal(id: 362, name: "Throne of Thunder", map: InstanceMapIndex(name: "Throne of Thunder", id: 1098), description: "When Pandaria separated from Kalimdor many thousands of years ago, a veil of mist kept outsiders from discovering the newly-formed continent. The mists also hid a reminder of an ancient evil: Lei Shen\'s Throne of Thunder. During his rule, this fortress was the seat of the Thunder King\'s power. Even after his death, great swathes of corrupted energy lingered, and now, the resurrected Thunder King and the Zandalari trolls intend to harness that energy to establish the reign of Lei Shen once again.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/827?namespace=static-8.3.7_35114-eu"), id: 827, name: "Jin\'rokh the Breaker"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/819?namespace=static-8.3.7_35114-eu"), id: 819, name: "Horridon"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/816?namespace=static-8.3.7_35114-eu"), id: 816, name: "Council of Elders"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/825?namespace=static-8.3.7_35114-eu"), id: 825, name: "Tortos"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/821?namespace=static-8.3.7_35114-eu"), id: 821, name: "Megaera"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/828?namespace=static-8.3.7_35114-eu"), id: 828, name: "Ji-Kun"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/818?namespace=static-8.3.7_35114-eu"), id: 818, name: "Durumu the Forgotten"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/820?namespace=static-8.3.7_35114-eu"), id: 820, name: "Primordius"), EncounterIndex(key: LinkStub(href: "https://eu.api.bl