        InstanceJournal(id: 457, name: "Blackrock Foundry", map: InstanceMapIndex(name: "Blackrock Foundry", id: 1205), description: "This foundry was the ancestral home of the Blackrock orcs, wherein master smiths smelted and worked the impossibly hard ore that is the clan\'s namesake. Now, massive giants captured and broken by the Thunderlord heat the great forges, flamebenders of the Burning Blade imbue the ore with an inner fire, and engineers shape the slag according to otherworldly schematics. Warlord Blackhand\'s foundry is the center of the Iron Horde\'s military might, churning out the weaponry that will be used to raze Azeroth.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1202?namespace=static-8.3.7_35114-eu"), id: 1202, name: "Oregorger"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1155?namespace=static-8.3.7_35114-eu"), id: 1155, name: "Hans\'gar and Franzok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1122?namespace=static-8.3.7_35114-eu"), id: 1122, name: "Beastlord Darmac"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1161?namespace=static-8.3.7_35114-eu"), id: 1161, name: "Gruul"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1123?namespace=static-8.3.7_35114-eu"), id: 1123, name: "Flamebender Ka\'graz"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1147?namespace=static-8.3.7_35114-eu"), id: 1147, name: "Operator Thogar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1154?namespace=static-8.3.7_35114-eu"), id: 1154, name: "The Blast Furnace"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1162?namespace=static-8.3.7_35114-eu"), id: 1162, name: "Kromog"), EncounterIndex