        InstanceJournal(id: 477, name: "Highmaul", map: InstanceMapIndex(name: "Highmaul", id: 1228), description: "Highmaul is the seat of power for the Gorian Empire, the ogre civilization that ruled Draenor for generations, until the arrival of the draenei. A massive city that belies the ogre reputation for brutish stupidity, Highmaul is full of bustling markets, wealthy nobles, and the roar of the Coliseum crowd echoing through the streets of the slums. Visible from everywhere within the city\'s walls, Imperator Mar\'gok\'s citadel casts a long shadow, a reminder of his watchful eye and iron grip.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1128?namespace=static-8.3.7_35114-eu"), id: 1128, name: "Kargath Bladefist"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/971?namespace=static-8.3.7_35114-eu"), id: 971, name: "The Butcher"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1195?namespace=static-8.3.7_35114-eu"), id: 1195, name: "Tectus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1196?namespace=static-8.3.7_35114-eu"), id: 1196, name: "Brackenspore"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1148?namespace=static-8.3.7_35114-eu"), id: 1148, name: "Twin Ogron"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1153?namespace=static-8.3.7_35114-eu"), id: 1153, name: "Ko\'ragh"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1197?namespace=static-8.3.7_35114-eu"), id: 1197, name: "Imperator Mar\'gok")], expansion: ExpansionIndex(id: 124, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/124?namespace=static-8.3.7_35114-eu"), name: "Warlords of Draenor"), modes: [InstanceMode(mode: InstanceModeName(type: "