        InstanceJournal(id: 669, name: "Hellfire Citadel", map: InstanceMapIndex(name: "Hellfire Citadel", id: 1448), description: "When Garrosh encouraged Grommash to begin construction of this massive stronghold at the heart of Tanaan Jungle, to serve as a staging ground for the assault of Azeroth, he even suggested the name Hellfire, pulled from a different time and a different land. He dreamed of seeing mighty orcish iron towering over an unblighted landscape, so very different from the wasteland he had known in Outland. But even as times change, so too do they stay the same.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1426?namespace=static-8.3.7_35114-eu"), id: 1426, name: "Hellfire Assault"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1425?namespace=static-8.3.7_35114-eu"), id: 1425, name: "Iron Reaver"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1392?namespace=static-8.3.7_35114-eu"), id: 1392, name: "Kormrok"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1432?namespace=static-8.3.7_35114-eu"), id: 1432, name: "Hellfire High Council"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1396?namespace=static-8.3.7_35114-eu"), id: 1396, name: "Kilrogg Deadeye"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1372?namespace=static-8.3.7_35114-eu"), id: 1372, name: "Gorefiend"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1433?namespace=static-8.3.7_35114-eu"), id: 1433, name: "Shadow-Lord Iskar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1427?namespace=static-8.3.7_35114-eu"), id: 1427, name: "Socrethar the Eternal"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/d