        InstanceJournal(id: 768, name: "The Emerald Nightmare", map: InstanceMapIndex(name: "The Emerald Nightmare", id: 1520), description: "The Emerald Dream was created by the titans as a blueprint for Azeroth itself - a verdant and perfect mirror that reflects the state of nature had it remained unspoiled by so-called civilization. For many years, the druids and keepers who are closest to nature have noticed signs of an unsettling presence stirring within the Dream. Spurred on by the Legion and Nightmare Lord Xavius, that creeping corruption has now burst forth, and will engulf all of Azeroth if it is not rooted out at its source.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1703?namespace=static-8.3.7_35114-eu"), id: 1703, name: "Nythendra"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1738?namespace=static-8.3.7_35114-eu"), id: 1738, name: "Il\'gynoth, Heart of Corruption"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1744?namespace=static-8.3.7_35114-eu"), id: 1744, name: "Elerethe Renferal"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1667?namespace=static-8.3.7_35114-eu"), id: 1667, name: "Ursoc"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1704?namespace=static-8.3.7_35114-eu"), id: 1704, name: "Dragons of Nightmare"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1750?namespace=static-8.3.7_35114-eu"), id: 1750, name: "Cenarius"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1726?namespace=static-8.3.7_35114-eu"), id: 1726, name: "Xavius")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [Instan