        InstanceJournal(id: 786, name: "The Nighthold", map: InstanceMapIndex(name: "The Nighthold", id: 1530), description: "The largest structure in the Broken Isles, and among the grandest in all of Azeroth, the Nighthold stands as a testament to the achievements of the nightborne civilization. Centered around the Nightwell, the fount of arcane power that has sustained Suramar for centuries, these grounds were built as a haven from the worries of the world. But as a felstorm churns above the former temple of Elune across the bay, and Gul\'dan himself now resides within the palace\'s walls, those worries now begin, not end, here.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1706?namespace=static-8.3.7_35114-eu"), id: 1706, name: "Skorpyron"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1725?namespace=static-8.3.7_35114-eu"), id: 1725, name: "Chronomatic Anomaly"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1731?namespace=static-8.3.7_35114-eu"), id: 1731, name: "Trilliax"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1751?namespace=static-8.3.7_35114-eu"), id: 1751, name: "Spellblade Aluriel"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1762?namespace=static-8.3.7_35114-eu"), id: 1762, name: "Tichondrius"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1713?namespace=static-8.3.7_35114-eu"), id: 1713, name: "Krosus"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1761?namespace=static-8.3.7_35114-eu"), id: 1761, name: "High Botanist Tel\'arn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1732?namespace=static-8.3.7_35114-eu"), id: 1732, name: "Star Augur Etraeus"), EncounterIndex(key