        InstanceJournal(id: 861, name: "Trial of Valor", map: InstanceMapIndex(name: "Trial of Valor", id: 1648), description: "Since Loken\'s betrayal, Odyn has been trapped within the Halls of Valor as Helya plots in the shadows to claim the souls of his valarjar champions. In recent days, however, great heroes have arrived in the lands of Stormheim in the Legion\'s wake. Hoping that their might and determination could tip the scales and end Helya\'s reign, Odyn summons these champions for a final test.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1819?namespace=static-8.3.7_35114-eu"), id: 1819, name: "Odyn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1830?namespace=static-8.3.7_35114-eu"), id: 1830, name: "Guarm"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1829?namespace=static-8.3.7_35114-eu"), id: 1829, name: "Helya")], expansion: ExpansionIndex(id: 395, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/395?namespace=static-8.3.7_35114-eu"), name: "Legion"), modes: [InstanceMode(mode: InstanceModeName(type: "LFR", name: "Raid Finder"), players: 30, isTracked: true), InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 30, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 30, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 20, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/861?namespace=static-8.3.7_35114-eu"), id: 861), minimumLevel: 110, category: InstanceCategory(type: .raid)),
        InstanceJournal(id: 875, name: "Tomb of Sargeras", map: InstanceMapIndex(name: "Tomb of Sargeras", id: 1676), description: "Aegwynn used this sacred temple of Elune to lock away the defeated Sargeras\' avatar. She hoped it would remain dormant, buried deep within the earth, but the lure of power has continued to draw foul entities to this site. When Gul\'dan re-entered the tomb, he tore down Aegwynn\'s wards and opened a doorway for the Legion to invade. Now, the fel army tears at the vault, hoping to reclaim their master\'s power.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1862?namespace=static-8.3.7_35114-eu"), id: 1862, name: "Goroth"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1867?namespace=static-8.3.7_35114-eu"), id: 1867, name: "Demonic Inquisition"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1856?namespace=static-8.3.7_35114-eu"), id: 1856, name: "Harjatan"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1903?namespace=static-8.3.7_35114-eu"), id: 1903, name: "Sisters of the Moon"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1861?namespace=static-8.3.7_35114-eu"), id: 1861, name: "Mistress Sassz\'ine"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1896?namespace=static-8.3.7_35114-eu"), id: 1896, name: "The Desolate Host"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1897?namespace=static-8.3.7_35114-eu"), id: 1897, name: "Maiden of Vigilance"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1873?namespace=static-8.3.7_35114-eu"), id: 1873, name: "Fallen Avatar"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1898?namespa