        InstanceJournal(id: 946, name: "Antorus, the Burning Throne", map: InstanceMapIndex(name: "Antorus, the Burning Throne", id: 1712), description: "At the core of Argus lies Antorus, the Burning Throne. From this seat of power, Sargeras drives his burning crusade to ravage the cosmos.\r\n\r\nWithin the Throne\'s nigh-impenetrable depths, primordial powers are being forged into weapons of utter annihilation. Should these forces rise to serve their master, the final hour will fall upon all of creation.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1992?namespace=static-8.3.7_35114-eu"), id: 1992, name: "Garothi Worldbreaker"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1987?namespace=static-8.3.7_35114-eu"), id: 1987, name: "Felhounds of Sargeras"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1997?namespace=static-8.3.7_35114-eu"), id: 1997, name: "Antoran High Command"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1985?namespace=static-8.3.7_35114-eu"), id: 1985, name: "Portal Keeper Hasabel"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2025?namespace=static-8.3.7_35114-eu"), id: 2025, name: "Eonar the Life-Binder"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2009?namespace=static-8.3.7_35114-eu"), id: 2009, name: "Imonar the Soulhunter"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2004?namespace=static-8.3.7_35114-eu"), id: 2004, name: "Kin\'garoth"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1986?namespace=static-8.3.7_35114-eu"), id: 1986, name: "The Coven of Shivarra"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/1983?names