        InstanceJournal(id: 1031, name: "Uldir", map: InstanceMapIndex(name: "Uldir", id: 1861), description: "Millennia ago, seeking to understand the nature of their eternal foe, the titans constructed this sprawling underground facility to research and quarantine captured specimens. They hoped that by studying the void energy that bound the Old Gods, probing it for weaknesses and reactions, they could find some way to neutralize it. They were horribly, horribly wrong. The facility was sealed away, so that the horrors within would never be unleashed upon Azeroth. But now those seals have broken....", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2168?namespace=static-8.3.7_35114-eu"), id: 2168, name: "Taloc"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2167?namespace=static-8.3.7_35114-eu"), id: 2167, name: "MOTHER"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2146?namespace=static-8.3.7_35114-eu"), id: 2146, name: "Fetid Devourer"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2169?namespace=static-8.3.7_35114-eu"), id: 2169, name: "Zek\'voz, Herald of N\'Zoth"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2166?namespace=static-8.3.7_35114-eu"), id: 2166, name: "Vectis"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2195?namespace=static-8.3.7_35114-eu"), id: 2195, name: "Zul, Reborn"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2194?namespace=static-8.3.7_35114-eu"), id: 2194, name: "Mythrax the Unraveler"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2147?namespace=static-8.3.7_35114-eu"), id: 2147, name: "G\'huun")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https:/