        InstanceJournal(id: 1176, name: "Battle of Dazar\'alor", map: InstanceMapIndex(name: "Battle of Dazar\'alor", id: 2070), description: "For ages untold, Dazar\'alor has stood at the center of the great and powerful Zandalari empire. Its guards have thwarted numerous attempts on King Rastakhan\'s life, and it has endured trials both ancient and new. But as war reaches the shores of Zuldazar, the Alliance embarks on a daring gambit to besiege the golden pyramid and sever the Zandalari\'s bond to the Horde.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2333?namespace=static-8.3.7_35114-eu"), id: 2333, name: "Champion of the Light"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2344?namespace=static-8.3.7_35114-eu"), id: 2344, name: "Champion of the Light"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2325?namespace=static-8.3.7_35114-eu"), id: 2325, name: "Grong, the Jungle Lord"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2340?namespace=static-8.3.7_35114-eu"), id: 2340, name: "Grong, the Revenant"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2323?namespace=static-8.3.7_35114-eu"), id: 2323, name: "Jadefire Masters"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2341?namespace=static-8.3.7_35114-eu"), id: 2341, name: "Jadefire Masters"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2342?namespace=static-8.3.7_35114-eu"), id: 2342, name: "Opulence"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2330?namespace=static-8.3.7_35114-eu"), id: 2330, name: "Conclave of the Chosen"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2335?namespace=s