        InstanceJournal(id: 1177, name: "Crucible of Storms", map: InstanceMapIndex(name: "Crucible of Storms", id: 2096), description: "A long-submerged evil stirs beneath the Shrine of the Storm. The whispers that drove Lord Stormsong to madness echo within the depths, a siren song of eldritch power. Those who listen and obey prepare dark rituals to carry out their master\'s will. Whatever nightmarish schemes fuel their fanatical devotion, one thing is certain: they must be stopped.", encounters: [EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2328?namespace=static-8.3.7_35114-eu"), id: 2328, name: "The Restless Cabal"), EncounterIndex(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-encounter/2332?namespace=static-8.3.7_35114-eu"), id: 2332, name: "Uu\'nat, Harbinger of the Void")], expansion: ExpansionIndex(id: 396, key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/journal-expansion/396?namespace=static-8.3.7_35114-eu"), name: "Battle for Azeroth"), modes: [InstanceMode(mode: InstanceModeName(type: "LFR", name: "Raid Finder"), players: 30, isTracked: true), InstanceMode(mode: InstanceModeName(type: "NORMAL", name: "Normal"), players: 30, isTracked: true), InstanceMode(mode: InstanceModeName(type: "HEROIC", name: "Heroic"), players: 30, isTracked: true), InstanceMode(mode: InstanceModeName(type: "MYTHIC", name: "Mythic"), players: 20, isTracked: true)], media: InstanceMediaStub(key: LinkStub(href: "https://eu.api.blizzard.com/data/wow/media/journal-instance/1177?namespace=static-8.3.7_35114-eu"), id: 1177), minimumLevel: 120, category: InstanceCategory(type: .raid)),
